import React, {Component} from 'react';
import StudiesService from "../services/DicomService";
import SearchBar from "../components/SearchBar";
import Table from "../components/Table";


class StudiesPage extends Component {
    constructor(props) {
        super(props);
        this.state = {
            studies: [],
            filterText: '', //搜索时用的过滤词语
        };
        this.setState.bind(this);
    }

    //更新过滤词
    handelFilter = (filterText) => {
        this.setState({
            filterText: filterText
        });
    };

    componentWillMount() {
        console.log("开始获取studies")
        StudiesService.findStudies(studyList => {
            console.log("找到studies了 如下")
            console.log(studyList);
            this.setState({studies: studyList})
            console.log(this.state.studies)
        });
    }

    render() {
        const studies = this.state.studies;
        return (
            <div>
                <h1>Studies</h1>
                <p>输入姓名关键字进行检索</p >
                <SearchBar 
                filterText={this.state.filterText}
                onFilterChange={this.handelFilter}/>
                <Table studies={studies} 
                filterText={this.state.filterText}/>
            </div>
        )
    }
}


export default StudiesPage;
